), temp2 AS (
	SELECT
		a15.ID_DT_MES					AS ID_DT_MES,
		pa12.DS_CMPR_COMPRA_EDIT		AS DS_CMPR_COMPRA_EDIT,
		a13.DS_CMPR_COMPRA_EDIT			AS DS_CMPR_COMPRA,
